import React, { useEffect, useState } from "react";
import { Form, Formik } from "formik";
import axios from "axios";
import { ToastContainer } from "react-toastify";
import { displayError, displaySuccess } from "../utils/toast";

const Register = () => {
  let [firstName, setFirstName] = useState("");
  let [lastName, setLastName] = useState("");
  let [email, setEmail] = useState("");
  let [password, setPassword] = useState("");
  let [dob, setDob] = useState("");
  let [address, setAddress] = useState("");
  let [gender, setGender] = useState("female");
  let [location, setLocation] = useState({});

  let success = (pos) => {
    console.log(pos);
    setLocation(pos);
  }
  let error = (e) => {
    console.log(e);
  }
  useEffect(() => {
    navigator.geolocation.getCurrentPosition(success, error);
  }, []);
  console.log(location);
  localStorage.setItem("latitude", location.coords?.latitude);
  localStorage.setItem("longitude", location.coords?.longitude);

  let onSubmit = async (e) => {
    e.preventDefault();
    let data = {
      firstName: firstName,
      lastName: lastName,
      email: email,
      password: password,
      dob: dob,
      address: address,
      gender: gender,
      role: "user"
    }
    console.log(data);
try {
      let result = await axios({
        url: `http://localhost:8000/users`,
        method: `post`,
        data: data
      });
      displaySuccess(result.data.message);
      console.log(result.data.message); 
} catch (error) {
  displayError(error.response.data.message);
  console.log(error.response.data.message);
}
  };
  return (
    <>
      <ToastContainer></ToastContainer>
      <form onSubmit={onSubmit}>
        <label htmlFor="firstName">First Name: </label>
        <input
          type="text"
          id="firstName"
          value={firstName}
          onChange={(e) => {
            setFirstName(e.target.value);
            // name=e.target.value;
          }}
        ></input>
        <br></br>
        <label htmlFor="lastName">Last Name: </label>
        <input
          type="text"
          id="lastName"
          value={lastName}
          onChange={(e) => {
            setLastName(e.target.value);
          }}
        ></input>
        <br></br>
        <label htmlFor="email">Email: </label>
        <input
          type="email"
          id="email"
          value={email}
          onChange={(e) => {
            setEmail(e.target.value);
          }}
        ></input>
        <br></br>
        <label htmlFor="password">Password</label>
        <input
          type="password"
          id="password"
          value={password}
          onChange={(e) => {
            setPassword(e.target.value);
          }}
        ></input>
        <br></br>
        <label htmlFor="dob">Date of Birth: </label>j
        <input
          type="date"
          id="dob"
          value={dob}
          onChange={(e) => {
            setDob(e.target.value);
          }}
        ></input>
        <br></br>
        <label htmlFor="address">Address: </label>
        <input
          type="text"
          id="address"
          value={address}
          onChange={(e) => {
            setAddress(e.target.value);
          }}
        ></input>
        <br></br>
        <label htmlFor="male">Male</label>
        <input type="radio" id="male" checked={gender === "male"} onChange={(e) => {
          setGender("male");
          // console.log(gender);
        }}></input>
        <label htmlFor="female">Female</label>
        <input type="radio" id="female" checked={gender === "female"} onChange={(e) => {
          setGender("female");
          // console.log(gender);
        }}></input>
        <label htmlFor="others">Others</label>
        <input type="radio" id="others" checked={gender === "others"} onChange={(e) => {
          setGender("others");
          // console.log(gender);
        }}></input>
        <br></br>
        <button type="submit">Register</button>
      </form>
    </>
  );
};

export default Register;
